import React from "react";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Navbar from '../components/Navbar'
import logodepartment from '../img/logo/logodepartment.png'

function PageLogin() {
  return (
    <div >
         <Navbar />
      <Box sx={{height: '80vh' ,display: 'flex',justifyContent: 'center',alignItems: 'center',flexDirection: 'column',background: "#6592FD"}}>
      <Box sx={{marginTop:'20px'}}>
            <Typography variant="subtitle1" sx={{color: '#ffffff',fontWeight: 'bold',fontSize: '24px'}}>
                เข้าสู่ระบบ
            </Typography>
        </Box>
      <Box sx={{top: "50%",left: "50%", width: '100%', maxWidth: 700,height: '100%',maxHeight: 400,display: 'flex',justifyContent: 'center',flexDirection: 'column',alignItems: 'center',borderRadius:'10px',borderStyle:'solid'}}>
        
        <Box sx={{display:'flex'}}>
                <Box>
                    <img src={logodepartment} alt="img" style={{width:'200px',height:'200px'}} />
                </Box>
        </Box>
        <Box sx={{display: 'flex'}}>

        </Box>
        </Box>
      </Box>
        
      
    </div>
  );
}

export default PageLogin;
